Gets an iterator for moving out the `BTreeSet`'s contents in ascending order.

# Examples

```
use std::collections::BTreeSet;

let set = BTreeSet::from([1, 2, 3, 4]);

let v: Vec<_> = set.into_iter().collect();
assert_eq!(v, [1, 2, 3, 4]);
```
